// danh sách các nốt nhạc
int melody[] = { NOTE_E4, NOTE_F4,NOTE_D4};

// thời gian các nốt nhạc: 4 = 1/4 nốt nhạc, 8 = 1/8nốt nhạc, ...:
int noteDurations[] = { 4, 8, 4};
   
void setup()
{
  display.begin();          // Instead of Serial.begin(9600)
  display.setTTYMode(true); // This set the TTY mode
  pinMode(IN_1, OUTPUT);
  pinMode(IN_2, OUTPUT);
  pinMode(IN_3, OUTPUT);
  pinMode(IN_4, OUTPUT);
  pinMode(ENA, OUTPUT);
  pinMode(ENB, OUTPUT);
  for (int thisNote = 0; thisNote < 3; thisNote++) 
  {
    // bây giờ ta đặt một nốt nhạc là 1 giây = 1000 mili giây
    // thì ta chia cho các thành phần noteDurations thì sẽ
    // được thời gian chơi các nốt nhạc
    // ví dụ: 4 => 1000/4; 8 ==> 1000/8 
    int noteDuration = 1000/noteDurations[thisNote];
    tone(buzzer, melody[thisNote],noteDuration);

    // để phân biệt các nốt nhạc hãy delay giữa các nốt nhạc
    // một khoảng thời gian vừa phải. Ví dụ sau đây thực hiện tốt
    // điều đó: Ta sẽ cộng 30% và thời lượng của một nốt
    int pauseBetweenNotes = noteDuration * 1.30;
    delay(pauseBetweenNotes);
    
    //Ngừng phát nhạc để sau đó chơi nhạc tiếp!
    noTone(buzzer);
  }
  if (timeReboot != timeLoad)
  {
    display.printf(">_\tPowered by: \n\n");
    display.printf("\t[-Qiu Qiu Robotic-]\n\n\n");
    display.printf("\t  Version: 1.0.0");
    delay(3000);
    display.clear();
    display.draw_bitmap(20, 8, 84, 48, logo, OLED::tColor::WHITE);
    display.display();
    delay(5000);
    display.clear();
    display.printf("    [Deverlopers]\n\n > 1.Ng. Hoang Lam\n\n > 2. Ng. H Gia Luyn");
    delay(3000);
    display.clear();
    display.printf(" [Lauching the Tomo]\n");
    display.printf("\n>_ Starting");
    int loadingEffect = 0;

    for (timeReboot = 0; timeReboot < timeLoad; timeReboot++)
    {
      loadingEffect++;
      if (loadingEffect <= 3)
      {
        display.printf(".");
      }
      else
      {
        display.clear();
        display.printf(" [Lauching the Tomo]\n");
        display.printf("\n>_Open: Tomo_V1.sys\n");
        display.printf("\n>_ Starting");
        loadingEffect = 0;
      }
      delay(500);
    }
  }
}

void loop()
{
  int emotionRandom = random(0, 8);
  display.clear();
  switch (emotionRandom)
  {
  case 0:
    displayOpenEye();
    break;
  case 1:
    displayAngryEye();
    break;
  case 2:
    displaySadEye();
    break;
  case 3:
    displayStunnedEye();
    break;
  case 4:
    displayCurious();
    break;
  case 5:
    displayBoredEye();
    break;
  case 6:
    displayLoveEye();
    break;
  case 7:
    displayLaugh();
    break;
  default:
    break;
  }
}